import React from 'react';

const UserList = (props) => {
    console.log(props.list)
    return (
        <div className='user-list'>
            <ul>
                <li>{props.list.name}</li>
                <li>{props.list.age}</li>
            </ul>
            <p></p>
        </div>
    );
};

export default UserList;
